x22// List Groups\x5cn\x5cn.list-group-item-variant(@state; @background; @color) {\x5cn  .list-group-item-@{state} {\x5cn    color: @color;\x5cn    background-color: @background;\x5cn\x5cn    a&,\x5cn    button& {\x5cn      color: @color;\x5cn\x5cn      .list-group-item-heading {\x5cn        color: inherit;\x5cn      }\x5cn\x5cn      &:hover,\x5cn      &:focus {\x5cn        color: @color;\x5cn        background-color: darken(@background, 5%);\x5cn      }\x5cn      &.active,\x5cn      &.active:hover,\x5cn      &.active:focus {\x5cn        color: #fff;\x5cn        background-color: @color;\x5cn        border-color: @color;\x5cn      }\x5cn    }\x5cn  }\x5cn}\x5cn\x22,\x22//\x5cn// Panels\x5cn// --------------------------------------------------\x5cn\x5cn\x5cn// Base class\x5cn.panel {\x5cn  margin-bottom: @line-height-computed;\x5cn  background-color: @panel-bg;\x5cn  border: 1px solid transparent;\x5cn  border-radius: @panel-border-radius;\x5cn  .box-shadow(0 1px 1px rgba(0,0,0,.05));\x5cn}\x5cn\x5cn// Panel contents\x5cn.panel-body {\x5cn  padding: @panel-body-padding;\x5cn  &:extend(.clearfix all);\x5cn}\x5cn\x5cn// Optional heading\x5cn.panel-heading {\x5cn  padding: @panel-heading-padding;\x5cn  border-bottom: 1px solid transparent;\x5cn  .border-top-radius((@panel-border-radius - 1));\x5cn\x5cn  \x3e .dropdown .dropdown-toggle {\x5cn    color: inherit;\x5cn  }\x5cn}\x5cn\x5cn// Within heading, strip any `h*` tag of its default margins for spacing.\x5cn.panel-title {\x5cn  margin-top: 0;\x5cn  margin-bottom: 0;\x5cn  font-size: ceil((@font-size-base * 1.125));\x5cn  color: inherit;\x5cn\x5cn  \x3e a,\x5cn  \x3e small,\x5cn  \x3e .small,\x5cn  \x3e small \x3e a,\x5cn  \x3e .small \x3e a {\x5cn    color: inherit;\x5cn  }\x5cn}\x5cn\x5cn// Optional footer (stays gray in every modifier class)\x5cn.panel-footer {\x5cn  padding: @panel-footer-padding;\x5cn  background-color: @panel-footer-bg;\x5cn  border-top: 1px solid @panel-inner-border;\x5cn  .border-bottom-radius((@panel-border-radius - 1));\x5cn}\x5cn\x5cn\x5cn// List groups in panels\x5cn//\x5cn// By default, space out list group content from panel headings to account for\x5cn// any kind of custom content between the two.\x5cn\x5cn.panel {\x5cn  \x3e .list-group,\x5cn  \x3e .panel-collapse \x3e .list-group {\x5cn    margin-bottom: 0;\x5cn\x5cn    .list-group-item {\x5cn      border-width: 1px 0;\x5cn      border-radius: 0;\x5cn    }\x5cn\x5cn    // Add border top radius for first one\x5cn    &:first-child {\x5cn      .list-group-item:first-child {\x5cn        border-top: 0;\x5cn        .border-top-radius((@panel-border-radius - 1));\x5cn      }\x5cn    }\x5cn\x5cn    // Add border bottom radius for last one\x5cn    &:last-child {\x5cn      .list-group-item:last-child {\x5cn        border-bottom: 0;\x5cn        .border-bottom-radius((@panel-border-radius - 1));\x5cn      }\x5cn    }\x5cn  }\x5cn  \x3e .panel-heading + .panel-collapse \x3e .list-group {\x5cn    .list-group-item:first-child {\x5cn      .border-top-radius(0);\x5cn    }\x5cn  }\x5cn}\x5cn// Collapse space between when there\x27s no additional content.\x5cn.panel-heading + .list-group {\x5cn  .list-group-item:first-child {\x5cn    border-top-width: 0;\x5cn  }\x5cn}\x5cn.list-group + .panel-footer {\x5cn  border-top-width: 0;\x5cn}\x5cn\x5cn// Tables in panels\x5cn//\x5cn// Place a non-bordered `.table` within a panel (not within a `.panel-body`) and\x5cn// watch it go full width.\x5cn\x5cn.panel {\x5cn  \x3e .table,\x5cn  \x3e .table-responsive \x3e .table,\x5cn  \x3e .panel-collapse \x3e .table {\x5cn    margin-bottom: 0;\x5cn\x5cn    caption {\x5cn      padding-left: @panel-body-padding;\x5cn      padding-right: @panel-body-padding;\x5cn    }\x5cn  }\x5cn  // Add border top radius for first one\x5cn  \x3e .table:first-child,\x5cn  \x3e .table-responsive:first-child \x3e .table:first-child {\x5cn    .border-top-radius((@panel-border-radius - 1));\x5cn\x5cn    \x3e thead:first-child,\x5cn    \x3e tbody:first-child {\x5cn      \x3e tr:first-child {\x5cn        border-top-left-radius: (@panel-border-radius - 1);\x5cn        border-top-right-radius: (@panel-border-radius - 1);\x5cn\x5cn        td:first-child,\x5cn        th:first-child {\x5cn          border-top-left-radius: (@panel-border-radius - 1);\x5cn        }\x5cn        td:last-child,\x5cn        th:last-child {\x5cn          border-top-right-radius: (@panel-border-radius - 1);\x5cn        }\x5cn      }\x5cn    }\x5cn  }\x5cn  // Add border bottom radius for last one\x5cn  \x3e .table:last-child,\x5cn  \x3e .table-responsive:last-child \x3e .table:last-child {\x5cn    .border-bottom-radius((@panel-border-radius - 1));\x5cn\x5cn    \x3e tbody:last-child,\x5cn    \x3e tfoot:last-child {\x5cn      \x3e tr:last-child {\x5cn        border-bottom-left-radius: (@panel-border-radius - 1);\x5cn        border-bottom-right-radius: (@panel-border-radius - 1);\x5cn\x5cn        td:first-child,\x5cn        th:first-child {\x5cn          border-bottom-left-radius: (@panel-border-radius - 1);\x5cn        }\x5cn        td:last-child,\x5cn        th:last-child {\x5cn          border-bottom-right-radius: (@panel-border-radius - 1);\x5cn        }\x5cn      }\x5cn    }\x5cn  }\x5cn  \x3e .panel-body + .table,\x5cn  \x3e .panel-body + .table-responsive,\x5cn  \x3e .table + .panel-body,\x5cn  \x3e .table-responsive + .panel-body {\x5cn    border-top: 1px solid @table-border-color;\x5cn  }\x5cn  \x3e .table \x3e tbody:first-child \x3e tr:first-child th,\x5cn  \x3e .table \x3e tbody:first-child \x3e tr:first-child td {\x5cn    border-top: 0;\x5cn  }\x5cn  \x3e .table-bordered,\x5cn  \x3e .table-responsive \x3e .table-bordered {\x5cn    border: 0;\x5cn    \x3e thead,\x5cn    \x3e tbody,\x5cn    \x3e tfoot {\x5cn      \x3e tr {\x5cn        \x3e th:first-child,\x5cn        \x3e td:first-child {\x5cn          border-left: 0;\x5cn        }\x5cn        \x3e th:last-child,\x5cn        \x3e td:last-child {\x5cn          border-right: 0;\x5cn        }\x5cn      }\x5cn    }\x5cn    \x3e thead,\x5cn    \x3e tbody {\x5cn      \x3e tr:first-child {\x5cn        \x3e td,\x5cn        \x3e th {\x5cn          border-bottom: 0;\x5cn        }\x5cn      }\x5cn    }\x5cn    \x3e tbody,\x5cn    \x3e tfoot {\x5cn      \x3e tr:last-child {\x5cn        \x3e td,\x5cn        \x3e th {\x5cn          border-bottom: 0;\x5cn        }\x5cn      }\x5cn    }\x5cn  }\x5cn  \x3e .table-responsive {\x5cn    border: 0;\x5cn    margin-bottom: 0;\x5cn  }\x5cn}\x5cn\x5cn\x5cn// Collapsable panels (aka, accordion)\x5cn//\x5cn// Wrap a series of panels in `.panel-group` to turn them into an accordion with\x5cn// the help of our collapse JavaScript plugin.\x5cn\x5cn.panel-group {\x5cn  margin-bottom: @line-height-computed;\x5cn\x5cn  // Tighten up margin so it\x27s only between panels\x5cn  .panel {\x5cn    margin-bottom: 0;\x5cn    border-radius: @panel-border-radius;\x5cn\x5cn    + .panel {\x5cn      margin-top: 5px;\x5cn    }\x5cn  }\x5cn\x5cn  .panel-heading {\x5cn    border-bottom: 0;\x5cn\x5cn    + .panel-collapse \x3e .panel-body,\x5cn    + .panel-collapse \x3e .list-group {\x5cn      border-top: 1px solid @panel-inner-border;\x5cn    }\x5cn  }\x5cn\x5cn  .panel-footer {\x5cn    border-top: 0;\x5cn    + .panel-collapse .panel-body {\x5cn      border-bottom: 1px solid @panel-inner-border;\x5cn    }\x5cn  }\x5cn}\x5cn\x5cn\x5cn// Contextual variations\x5cn.panel-default {\x5cn  .panel-variant(@panel-default-border; @panel-default-text; @panel-default-heading-bg; @panel-default-border);\x5cn}\x5cn.panel-primary {\x5cn  .panel-variant(@panel-primary-border; @panel-primary-text; @panel-primary-heading-bg; @panel-primary-border);\x5cn}\x5cn.panel-success {\x5cn  .panel-variant(@panel-success-border; @panel-success-text; @panel-success-heading-bg; @panel-success-border);\x5cn}\x5cn.panel-info {\x5cn  .panel-variant(@panel-info-border; @panel-info-text; @panel-info-heading-bg; @panel-info-border);\x5cn}\x5cn.panel-warning {\x5cn  .panel-variant(@panel-warning-border; @panel-warning-text; @panel-warning-heading-bg; @panel-warning-border);\x5cn}\x5cn.panel-danger {\x5cn  .panel-variant(@panel-danger-border; @panel-danger-text; @panel-danger-heading-bg; @panel-danger-border);\x5cn}\x5cn\x22,\x22// Panels\x5cn\x5cn.panel-variant(@border; @heading-text-color; @heading-bg-color; @heading-border) {\x5cn  border-color: @border;\x5cn\x5cn  & \x3e .panel-heading {\x5cn    color: @heading-text-color;\x5cn    background-color: @heading-bg-color;\x5cn    border-color: @heading-border;\x5cn\x5cn    + .panel-collapse \x3e .panel-body {\x5cn      border-top-color: @border;\x5cn    }\x5cn    .badge {\x5cn      color: @heading-bg-color;\x5cn      background-color: @heading-text-color;\x5cn    }\x5cn  }\x5cn  & \x3e .panel-footer {\x5cn    + .panel-collapse \x3e .panel-body {\x5cn      border-bottom-color: @border;\x5cn    }\x5cn  }\x5cn}\x5cn\x22,\x22// Embeds responsive\x5cn//\x5cn// Credit: Nicolas Gallagher and SUIT CSS.\x5cn\x5cn.embed-responsive {\x5cn  position: relative;\x5cn  display: block;\x5cn  height: 0;\x5cn  padding: 0;\x5cn  overflow: hidden;\x5cn\x5cn  .embed-responsive-item,\x5cn  iframe,\x5cn  embed,\x5cn  object,\x5cn  video {\x5cn    position: absolute;\x5cn    top: 0;\x5cn    left: 0;\x5cn    bottom: 0;\x5cn    height: 100%;\x5cn    width: 100%;\x5cn    border: 0;\x5cn  }\x5cn}\x5cn\x5cn// Modifier class for 16:9 aspect ratio\x5cn.embed-responsive-16by9 {\x5cn  padding-bottom: 56.25%;\x5cn}\x5cn\x5cn// Modifier class for 4:3 aspect ratio\x5cn.embed-responsive-4by3 {\x5cn  padding-bottom: 75%;\x5cn}\x5cn\x22,\x22//\x5cn// Wells\x5cn// --------------------------------------------------\x5cn\x5cn\x5cn// Base class\x5cn.well {\x5cn  min-height: 20px;\x5cn  padding: 19px;\x5cn  margin-bottom: 20px;\x5cn  background-color: @well-bg;\x5cn  border: 1px solid @well-border;\x5cn  border-radius: @border-radius-base;\x5cn  .box-shadow(inset 0 1px 1px rgba(0,0,0,.05));\x5cn  blockquote {\x5cn    border-color: #ddd;\x5cn    border-color: rgba(0,0,0,.15);\x5cn  }\x5cn}\x5cn\x5cn// Sizes\x5cn.well-lg {\x5cn  padding: 24px;\x5cn  border-radius: @border-radius-large;\x5cn}\x5cn.well-sm {\x5cn  padding: 9px;\x5cn  border-radius: @border-radius-small;\x5cn}\x5cn\x22,\x22//\x5cn// Close icons\x5cn// --------------------------------------------------\x5cn\x5cn\x5cn.close {\x5cn  float: right;\x5cn  font-size: (@font-size-base * 1.5);\x5cn  font-weight: @close-font-weight;\x5cn  line-height: 1;\x5cn  color: @close-color;\x5cn  text-shadow: @close-text-shadow;\x5cn  .opacity(.2);\x5cn\x5cn  &:hover,\x5cn  &:focus {\x5cn    color: @close-color;\x5cn    text-decoration: none;\x5cn    cursor: pointer;\x5cn    .opacity(.5);\x5cn  }\x5cn\x5cn  // Additional properties for button version\x5cn  // iOS requires the button element instead of an anchor tag.\x5cn  // If you want the anchor version, it requires `href=\x5c\x22#\x5c\x22`.\x5cn  // See https://developer.mozilla.org/en-US/docs/Web/Events/click#Safari_Mobile\x5cn  button& {\x5cn    padding: 0;\x5cn    cursor: pointer;\x5cn    background: transparent;\x5cn    border: 0;\x5cn    -webkit-appearance: none;\x5cn  }\x5cn}\x5cn\x22,\x22//\x5cn// Modals\x5cn// --------------------------------------------------\x5cn\x5cn// .modal-open      - body class for killing the scroll\x5cn// .modal           - container to scroll within\x5cn// .modal-dialog    - positioning shell for the actual modal\x5cn// .modal-content   - actual modal w/ bg and corners and shit\x5cn\x5cn// Kill the scroll on the body\x5cn.modal-open {\x5cn  overflow: hidden;\x5cn}\x5cn\x5cn// Container that the modal scrolls within\x5cn.modal {\x5cn  display: none;\x5cn  overflow: hidden;\x5cn  position: fixed;\x5cn  top: 0;\x5cn  right: 0;\x5cn  bottom: 0;\x5cn  left: 0;\x5cn  z-index: @zindex-modal;\x5cn  -webkit-overflow-scrolling: touch;\x5cn\x5cn  // Prevent Chrome on Windows from adding a focus outline. For details, see\x5cn  // https://github.com/twbs/bootstrap/pull/10951.\x5cn  outline: 0;\x5cn\x5cn  // When fading in the modal, animate it to slide down\x5cn  &.fade .modal-dialog {\x5cn    .translate(0, -25%);\x5cn    .transition-transform(~\x5c\x220.3s ease-out\x5c\x22);\x5cn  }\x5cn  &.in .modal-dialog { .translate(0, 0) }\x5cn}\x5cn.modal-open .modal {\x5cn  overflow-x: hidden;\x5cn  overflow-y: auto;\x5cn}\x5cn\x5cn// Shell div to position the modal with bottom padding\x5cn.modal-dialog {\x5cn  position: relative;\x5cn  width: auto;\x5cn  margin: 10px;\x5cn}\x5cn\x5cn// Actual modal\x5cn.modal-content {\x5cn  position: relative;\x5cn  background-color: @modal-content-bg;\x5cn  border: 1px solid @modal-content-fallback-border-color; //old browsers fallback (ie8 etc)\x5cn  border: 1px solid @modal-content-border-color;\x5cn  border-radius: @border-radius-large;\x5cn  .box-shadow(0 3px 9px rgba(0,0,0,.5));\x5cn  background-clip: padding-box;\x5cn  // Remove focus outline from opened modal\x5cn  outline: 0;\x5cn}\x5cn\x5cn// Modal background\x5cn.modal-backdrop {\x5cn  position: fixed;\x5cn  top: 0;\x5cn  right: 0;\x5cn  bottom: 0;\x5cn  left: 0;\x5cn  z-index: @zindex-modal-background;\x5cn  background-color: @modal-backdrop-bg;\x5cn  // Fade for backdrop\x5cn  &.fade { .opacity(0); }\x5cn  &.in { .opacity(@modal-backdrop-opacity); }\x5cn}\x5cn\x5cn// Modal header\x5cn// Top section of the modal w/ title and dismiss\x5cn.modal-header {\x5cn  padding: @modal-title-padding;\x5cn  border-bottom: 1px solid @modal-header-border-color;\x5cn  min-height: (@modal-title-padding + @modal-title-line-height);\x5cn}\x5cn// Close icon\x5cn.modal-header .close {\x5cn  margin-top: -2px;\x5cn}\x5cn\x5cn// Title text within header\x5cn.modal-title {\x5cn  margin: 0;\x5cn  line-height: @modal-title-line-height;\x5cn}\x5cn\x5cn// Modal body\x5cn// Where all modal content resides (sibling of .modal-header and .modal-footer)\x5cn.modal-body {\x5cn  position: relative;\x5cn  padding: @modal-inner-padding;\x5cn}\x5cn\x5cn// Footer (for actions)\x5cn.modal-footer {\x5cn  padding: @modal-inner-padding;\x5cn  text-align: right; // right align buttons\x5cn  border-top: 1px solid @modal-footer-border-color;\x5cn  &:extend(.clearfix all); // clear it in case folks use .pull-* classes on buttons\x5cn\x5cn  // Properly space out buttons\x5cn  .btn + .btn {\x5cn    margin-left: 5px;\x5cn    margin-bottom: 0; // account for input[type=\x5c\x22submit\x5c\x22] which gets the bottom margin like all other inputs\x5cn  }\x5cn  // but override that for button groups\x5cn  .btn-group .btn + .btn {\x5cn    margin-left: -1px;\x5cn  }\x5cn  // and override it for block buttons as well\x5cn  .btn-block + .btn-block {\x5cn    margin-left: 0;\x5cn  }\x5cn}\x5cn\x5cn// Measure scrollbar width for padding body during modal show/hide\x5cn.modal-scrollbar-measure {\x5cn  position: absolute;\x5cn  top: -9999px;\x5cn  width: 50px;\x5cn  height: 50px;\x5cn  overflow: scroll;\x5cn}\x5cn\x5cn// Scale up the modal\x5cn@media (min-width: @screen-sm-min) {\x5cn  // Automatically set modal\x27s width for larger viewports\x5cn  .modal-dialog {\x5cn    width: @modal-md;\x5cn    margin: 30px auto;\x5cn  }\x5cn  .modal-content {\x5cn    .box-shadow(0 5px 15px rgba(0,0,0,.5));\x5cn  }\x5cn\x5cn  // Modal sizes\x5cn  .modal-sm { width: @modal-sm; }\x5cn}\x5cn\x5cn@media (min-width: @screen-md-min) {\x5cn  .modal-lg { width: @modal-lg; }\x5cn}\x5cn\x22,\x22//\x5cn// Tooltips\x5cn// --------------------------------------------------\x5cn\x5cn\x5cn// Base class\x5cn.tooltip {\x5cn  position: absolute;\x5cn  z-index: @zindex-tooltip;\x5cn  display: block;\x5cn  // Our parent element can be arbitrary since tooltips are by default inserted as a sibling of their target element.\x5cn  // So reset our font and text properties to avoid inheriting weird values.\x5cn  .reset-text();\x5cn  font-size: @font-size-small;\x5cn\x5cn  .opacity(0);\x5cn\x5cn  &.in     { .opacity(@tooltip-opacity); }\x5cn  &.top    { margin-top:  -3px; padding: @tooltip-arrow-width 0; }\x5cn  &.right  { 